import { flexWrap } from "styled-system";
import React from "React"
import NodeFetch from 'node-fetch' 
import {fetch as fetchPolyfill} from 'whatwg-fetch'


// for only last 2 datas 
let url = "https://api.thingspeak.com/channels/838448/feeds.json?results=1";

// let url = "https://api.thingspeak.com/channels/838448/field1.json";


// for whole data 
// let url = "https://api.thingspeak.com/channels/838448/feeds.json";

let settings = { method: "Get" };
var $value = 5

const thisFunction = function () {
var val = fetch(url, settings)
    .then(res => res.json())
    .then((json) => {
        // do something with JSON
        // console.log(json)
        var channel = json.channel
        var feeds = json.feeds

        // console.log(channel)
        // console.log(feeds)
        var buf =feeds[0].field3;
        const {good}=buf
        console.log(buf);
        window.$value55=buf
        $value=buf
         
        // return buf;
    
    });
    
    return val;
}

const good="Fine.gooodies"
let bad=thisFunction()
console.log(good)


class Welcome extends React.Component {

    render() {

      return (
        <h1>{bad} {this.props.name}</h1>
      )
    }
  }

export default Welcome;
